import React from "react";
// import MenuIcon from '@mui/icons-material/Menu';
// import HamburgerMenu from "./Hamburger";
import "./Navbar.css";

import { Link } from "react-router-dom";
import HamburgerMenu from "./Hamburger";


// function toggle() {
//   var content = document.getElementById("myTopnav");
//   if (content.style.display === "none") {
//     content.style.display = "block";
//   } else {
//     content.style.display = "none";
//   }
// }


function Navbar() {
  return (
    <>
      
      <div className="navbar-title   topnav" id="myTopnav" >
        
        <table className="navbar-table">
          <tr className="navbar-name">
            <th>
              <Link to="/">
                <p className="navbar-menu">Home</p>
              </Link>
            </th>
            <th >
              <Link to="/about">
                <p >About</p>
              </Link>
            </th>
            <th >
              <Link to="/work">
                <p className="navbar-menu">Work</p>
              </Link>
            </th>
            <th >
              <Link  to="/contact">
                <p  className="navbar-menu">Contact</p>
              </Link>
            </th>
          </tr>
        </table>
        
      </div>
      <div className="hamburger" >
        <HamburgerMenu/>
      
    </div>

    </>
  );
}

export default Navbar;

